import React from 'react';
import './home.css';

export default function() {
  return (
    <div className='home'>
            <p className="card-text">Welcome to BENGO where everything you need are avalibal.
            
            <br></br>Meet your one stop for something sparkles, 
            <br></br>something new, with something timeless and
            <br></br>personal to you.</p><br></br><br></br>

        <img src="/assets/home.png" className="card-img"></img>
    </div>
  )
}
